import { useState, useEffect } from "react";
import feather from "feather-icons"

function Header(){
    const [isSidebarOpen, setIsSidebarOpen] = useState(false);

    useEffect(() => {
        feather.replace();
    }, []);

    return(
        <header className="navi">
            {/* Change this line: nav-container to navi-container */}
            <div className="navi-container">  {/* <-- ADDED THE "i" */}
            <ul>
                <img src="/imgs/temple.png" alt="Logo" />
                <nav className="desktop-navi">
                    <div className="links">
                        <ul className="sidebar">
                                <li><a href="#">Home</a></li>
                                <li><a href="#">Über uns</a></li>
                                <li><a href="#">Wettbewerbe</a></li>
                                <li><a href="#">Trainingszeiten</a></li>
                        </ul>
                        <li><a href="#">Home</a></li>
                        <li><a href="#">Über uns</a></li>
                        <li><a href="#">Wettbewerbe</a></li>
                        <li><a href="#">Trainingszeiten</a></li>
                        <li><a href="#" onClick={(e)=>{
                            e.preventDefault();
                            setIsSidebarOpen(!isSidebarOpen);
                        }} rel="noreferrer">
                            <i data-feather="menu" className="menu-icon"></i>
                            </a></li>
                    </div>
                </nav>
            </ul>
            </div>
        </header>
    );
}

export default Header;
